import React from "react";

function Navbar({ user, onLogout }) {
  return (
    <nav className="navbar">
      <h2>üìù Simple Blog</h2>
      {user && (
        <div className="nav-user">
          <img
            src={user.picture}
            alt="profile"
            className="user-pic"
            style={{
              width: "35px",
              height: "35px",
              borderRadius: "50%",
              marginRight: "10px",
            }}
          />
          <span>{user.name || user.given_name}</span>
          <button onClick={onLogout}>Logout</button>
        </div>
      )}
    </nav>
  );
}

export default Navbar;
